import React from "react";
import InputSection from "./components/InputSection";

function App() {
  const handlePrediction = (skill, field) => {
    console.log("Predicting career for:", skill, field);
    // Here, you'll call the backend API to get predictions
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      <h1 className="text-2xl font-bold mb-6">Career Predictor</h1>
      <InputSection onPredict={handlePrediction} />
    </div>
  );
}

export default App;
